import React, { useState, useEffect } from 'react';
import axios from 'axios';
import '../styles/TargetForm.css';
import { Autocomplete, TextField, Button } from '@mui/material';

function TargetForm() {
    const [targets, setTargets] = useState([]);
    const [target, setTarget] = useState('');
    const [ra, setRa] = useState('');
    const [dec, setDec] = useState('');
    const [exposure, setExposure] = useState('');
    const [mode, setMode] = useState('');
    const [message, setMessage] = useState('');

    useEffect(() => {
        axios.get('http://127.0.0.1:5000/api/targets')
            .then(response => {
                setTargets(response.data);
            })
            .catch(error => {
                console.error('Error fetching targets:', error);
            });
    }, []);

    const handleTargetChange = (e) => {
        const targetName = e.target.value;
        setTarget(targetName);

        if (targetName === 'new target') {
            setRa('');
            setDec('');
        } else {
            const target = targets.find(t => t.name === targetName);
            if (target) {
                setRa(target.ra);
                setDec(target.dec);
            }
        }
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            const response = await axios.post('http://127.0.0.1:5000/api/send_email', {
                target,
                ra,
                dec,
                exposure,
                mode,
            });
            setMessage(response.data.message);
        } catch (error) {
            console.error("Error sending email:", error);
            setMessage("Failed to send email.");
        }
    };


    return (
        <div className="container">
            <h2>7DT Target of Opportunity (ToO) Request</h2>
            <form onSubmit={handleSubmit}>
                <div style={{ marginBottom: '15px' }}>
                    <Autocomplete
                        options={targets}
                        getOptionLabel={(option) => option.name || ''}
                        onChange={handleTargetChange}
                        renderInput={(params) => (
                            <TextField
                                {...params}
                                label="Target"
                                variant="outlined"
                                fullWidth
                                sx={{
                                    '& .MuiOutlinedInput-root': {
                                        borderRadius: '5px',
                                    },
                                }}
                            />
                        )}
                        isOptionEqualToValue={(option, value) => option.name === value.name}
                        freeSolo
                    />
                </div>
                <div>
                    <label htmlFor="ra">R.A. (degrees):</label>
                    <input
                        id="ra"
                        type="text"
                        value={ra}
                        onChange={(e) => setRa(e.target.value)}
                        disabled={target !== 'new target'}
                        className={target !== 'new target' ? 'disabled' : ''}
                    />
                </div>

                <div>
                    <label htmlFor="dec">Dec. (degrees):</label>
                    <input
                        id="dec"
                        type="text"
                        value={dec}
                        onChange={(e) => setDec(e.target.value)}
                        disabled={target !== 'new target'}
                        className={target !== 'new target' ? 'disabled' : ''}
                    />
                </div>

                <div>
                    <label htmlFor="exposure">Exposure (seconds):</label>
                    <input
                        id="exposure"
                        type="text"
                        value={exposure}
                        onChange={(e) => setExposure(e.target.value)}
                    />
                </div>

                <div>
                    <label htmlFor="mode">Mode:</label>
                    <select
                        id="mode"
                        value={mode}
                        onChange={(e) => setMode(e.target.value)}
                    >
                        <option value="">--Select a Mode--</option>
                        <option value="Mode A">Mode A</option>
                        <option value="Mode B">Mode B</option>
                        <option value="Mode C">Mode C</option>
                    </select>
                </div>

                <button type="submit">Submit</button>
            </form>
            {message && <p>{message}</p>}
        </div>
    );
}

export default TargetForm;
